Dear MOOSE Community,
I hope this message finds you well, and I'm currently continuing to complete goal #25687. As part of this task, I am attempting to access a material property of type MaterialProperty<std::vector<Real>> _slip_resistance  within the CrystalPlasticityStressUpdateBase material class, through the use of a VectorPostprocessor and named FeatureMatePropVectorPostprocessorV2.
FeatureMatePropVectorPostprocessorV2.h
  const MaterialProperty<Real> & _test_real;
  const MaterialProperty<std::vector<Real>> & _slip_resistance;
FeatureMatePropVectorPostprocessorV2.C
FeatureMatePropVectorPostprocessorV2::FeatureMatePropVectorPostprocessorV2(
    const InputParameters & parameters)
  : FeatureVolumeVectorPostprocessorCopy(parameters),
    _mat_prop_qp(getMaterialProperty<Real>("mat_prop")),
    _slip_resistance(getMaterialProperty<std::vector<Real>>("slip_resistance")),
    _test_real(getMaterialProperty<Real>("test_real")),
    _mat_prop_aves(declareVector("mat_prop_aves")),
    _grain_id_to_slip_resistances_map()
{
  std::cout << "the done of FeatureMatePropVectorPostprocessorV2" << std::endl;
}

void
FeatureMatePropVectorPostprocessorV2::initialize()
{
  std::cout << "FeatureMatePropVectorPostprocessorV2::initialize()" << std::endl;
  std::cout << "_test_real: " << _test_real[0] << std::endl;
  std::cout << "_slip_resistance["<< 0 << "].size() " << _slip_resistance[0].size() << std::endl;
}
Output results:

However, despite my efforts, I have encountered difficulties in accessing the _slip_resistance property. Strangely, I have found that I can successfully retrieve a material property of type MaterialProperty<Real> (e.g., _test_real), but I am facing challenges when attempting to access std::vector<Real>-type material properties, such as _slip_resistance.
I would greatly appreciate your guidance and insights into this matter. I am looking for a solution or suggestions on how to access and work with material properties of the std::vector<Real> type through a VectorPostprocessor. Understanding how to access and manipulate these properties is crucial for the successful completion of my task.
If you require any additional information or code snippets to better understand the issue, please do not hesitate to ask. Your assistance in resolving this matter will be immensely valuable.
Thank you in advance for your time and support. I look forward to your response and guidance.
Best regards,
Wei

